function genList()
{
	function pickName()
	{
		if(Math.random() > 0.5)
		{
			return "Bob";
		} else {
			return "Billy";
		}
	}

	function genPhone()
	{
		var phone = [];
		for(var i = 0; i < 12; i++)
		{
			if(i == 3 || i == 7) phone.push("-");
			else phone.push( Math.floor((Math.random()*9)) );
		}
		return phone.join('');
	}

	var item;
	var list = [];
	for(var i = 0; i < 10000; ++i)
	{
		item = { name: pickName(),
			     phone: genPhone()
		       };
		list.push(item);
	}

	return list;
}
